#时间格式函数
def formatMethod(t_param):
    #时间参数小于10的，以‘0X’格式显示
    if t_param < 10:
        result = '0' + str(t_param)
    else :
        result = str(t_param)
    return result

def getRandTime():
    #时间定为2015年1月至5月
    year = '2015'
    month = random.randrange(1, 6)
    if month == 2:
        date = random.randrange(1, 29)
    elif month == 4:
        date = random.randrange(1, 31)
    else :
        date = random.randrange(1, 32)
    hour = random.randrange(0, 24)

    return year + formatMethod(month) + formatMethod(date) + formatMethod(hour)
